INSERT INTO `categories` (`id`, `title`, `description`, `is_published`, `qcode`, `magazine_only`, `taxonomy`, `date_created`) VALUES
(1, 'Feng Shui ', '', 1, '2433113806236116', 0, '', '2019-11-01 09:54:38'),
(2, 'Purple Star Astrology', '', 1, '7783071069977780', 0, '', '2019-11-01 09:54:49'),
(3, 'Bazi', 'The Four Pillars of Destiny, as known as \"Bazi\", which means \"eight characters\" or \"eight words\" in Chinese. It is a Chinese astrological concept that a person\'s destiny or fate can be divined by the two sexagenary cycle characters (Stems-and-Branches sixty cycle) assigned to their birth year, month', 1, '5638776897817040', 0, 'Auxiliary Star (Shen Sha), Four Pillars of Destiny', '2019-11-01 17:00:09'),
(4, 'Chinese Metaphysics', '', 1, '900890808035532', 1, '', '2019-11-27 15:57:38'),
(5, 'Xuan Kong Flying Stars', 'Xuan Kong Flying Star Feng Shui or Xuan Kong Fei Xing is a Feng Shui concept using time, space and objects to create an astrological chart to analyze positive auras and negative auras of a property. The concept analyses wealth, mental and physiological states, success, relationships with external pa', 1, '4110129082548783', 0, 'Xuan Kong Flying Stars, Feng Shui, Eight Mansions', '2020-01-02 07:55:48'),
(6, 'Spritual Qi Men ', 'Spiritual Qi Men (Fa Qi Men ???) is a Chinese Metaphysics tool to measure Qi or energy. There are many form of energy vibration in the environment which called Qi. Qi Men can be applied as a tool to map these energies. Through the deployment of specific Qi Men Chart, we can tailor our life approach ', 1, '0883383765694691', 0, 'spritual-qi-men-', '2020-01-02 08:06:23'),
(7, 'Chinese Solar Calendar', 'Chinese Almanac', 1, '4167230411263725', 0, 'chinese-solar-calendar', '2021-01-01 00:40:54');
