(45, 'Bazichic September 2019', 'bazichik20200101022152.pdf', '8605838899701579.jpg', 0, 'In this issue, we take a stab at forecasting the outcome of the ongoing trade war between the US and China. We also use Qi Men analysis to forecast the outlook for the year 2020. Learn how Qi transitions from year to year and get Feng Shui tips on making the best of the last quarter of 2019. Lastly, Jo analyses the Feng Shui of the Xiaoling Mausoleum and its impact on the Ming Dynasty. ', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 69, 0, 0, 0, '', 1, 'application/pdf', '', '8605838899701579', '2019-12-30 01:30:46', '2020-03-23 03:29:50', '2019-12-30 01:30:47'),
(43, 'Bazichic March 2019', 'bazichic20200323000003.pdf', '6411472230354521.jpg', 0, 'The March 2019 issue explores the existence of Qi and whether it can be measured. We also give tips on transforming negative Qi into positive Qi. We let you in on the secret of the Seven Star Robbery structure and its application in Feng Shui analysis. Also, Jo goes on a busman’s holiday to Ipoh where she has fun analyzing the Feng Shui of the many cave temples that can be found there. ', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 67, 0, 0, 0, '', 1, 'application/pdf', '', '6411472230354521', '2019-12-30 01:05:14', '2020-03-23 03:43:11', '2019-12-30 01:05:14'),
(44, 'Bazichic June 2019', 'bazichik20200101022234.pdf', '3375391846285777.jpg', 0, 'The June 2019 issue takes you to the magical city of Shanghai where we look at how the surrounding landform has fuelled the development of this vibrant city. We also look at travel from a Feng Shui and Bazi perspective. Learn about the Travelling Stars and get tips on harnessing the Cosmic Trinity - Heaven, Earth and Man Luck for safe travels. ', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 75, 0, 0, 0, '', 1, 'application/pdf', '', '3375391846285777', '2019-12-30 01:16:47', '2020-03-23 03:30:37', '2019-12-30 01:16:47'),
(41, 'Bazichic September 2018', 'bazichic20200323000004.pdf', '7485065163541021.jpg', 0, 'In the September 2018 issue of the magazine, we offer insight into how large scale festivities and celebrations can enhance the universal Qi around us. This issue highlights how the Qi created by these celebrations can speed up the fulfilment of wishes. We also look at the gradual rise Qi of Period, which is beginning to make its effects felt at the tail end of Period 8.', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 84, 0, 0, 0, '', 1, 'application/pdf', '', '7485065163541021', '2019-12-29 07:02:38', '2020-03-23 03:52:49', '2019-12-29 07:02:38'),
