(38, 'Bazichic December 2017', 'bazichik20200101023455.pdf', '6517786118271379.jpg', 0, 'The December 2017 issue features the Feng Shui and Chinese Astrology outlook for the year 2018. This issue divines what\'s in store in the year of the Earth Dog for the 12 signs of the Chinese Zodiac and the world at large. Also, learn how to make the most of the year by harnessing the year’s positive Annual Stars and avoiding the Feng Shui afflicted sectors in 2018.', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 105, 0, 0, 0, '', 1, 'application/pdf', '', '6517786118271379', '2019-12-29 01:44:48', '2020-03-23 04:49:07', '2019-12-29 01:44:48'),
(39, 'Bazichic March 2018', 'bazichik20200101023413.pdf', '1161173217981598.jpg', 0, 'The March 2018 issue is our rather macabre “graveyard” issue as we look into the rites and superstitions surrounding the Qing Ming Festival. Death is a part of life and the Feng Shui of our resting place will have an impact on the coming generations. Thus we look at the pros and cons of various burial methods from a Feng Shui perspective and features to avoid in ancestral graves. Jo also looks at how the Feng Shui of royal tombs have impacted the fortunes of Qin Shi Huang, the first Emperor of China and Empress Wu Zetian. ', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 69, 0, 0, 0, '', 1, 'application/pdf', '', '1161173217981598', '2019-12-29 03:11:18', '2020-03-23 04:44:06', '2019-12-29 03:11:18'),
(40, 'Bazichic June 2018', 'bazichic20200323000006.pdf', '6951346007671772.jpg', 0, 'The June 2018 issue highlights the Chinese Hungry Ghost Festival, the view of spirits in term of modern science, Feng Shui and other metaphysics studies. This issue offers insight to taboo of Chinese Hungry Ghost Festival that still practices by many till this day. This issue includes Feng Shui tips to clear stagnant or Yin energy of a property.', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 0, 0, 0, 0, '', 1, 'application/pdf', '', '6951346007671772', '2019-12-29 03:48:11', '2020-03-23 04:42:06', '2019-12-29 03:48:12'),
