(37, 'Bazichic September 2017', 'bazichik20191229010749.pdf', '3033020907432478.jpg', 0, 'In the September 2017 issue, Jo takes a closer look at the architecture of the Temple of Heaven in Beijing, which was built using Taoist and Feng Shui principles. We explain how the Qi Men Dun Jia divination system can be used for destiny analysis and why location is prioritized over direction in Feng Shui. This issue also offers tips on how Feng Shui can be personalised to help an individual make the most of the Qi in a property.', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 75, 0, 0, 0, '', 1, 'application/pdf', '', '3033020907432478', '2019-12-28 16:10:21', '2020-03-23 04:54:42', '2019-12-28 16:10:22'),
(23, 'Bazichic March 2014', 'bazichik20191227031320.pdf', '6704180053117011.jpg', 0, 'The Bazichic March 2014 issue features a special segment on the wealth outlook in 2014. Also, learn how you can use Bazi to identify your investment style and wealth luck. This issue examines the Fukushima Daiichi nuclear disaster, look at the man behind Playboy magazine and share words of wisdom from Hong Kong billionaire Li Ka-Shing. ', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 104, 0, 0, 0, '', 1, '', '', '6704180053117011', '2019-12-27 03:11:46', '2020-03-23 06:55:02', '2019-12-27 03:11:47'),
(24, 'Bazichic June 2014', 'bazichik20191227073316.pdf', '3689968117801193.jpg', 0, 'Love is in the air in this issue of Bazichic Magazine. We look at relationship matters, love, marriage and romance from a Feng Shui and Bazi perspective. We address some of the conflicting issues that arise before and after married life. Get some Feng Shui tips on how you can maintain harmonious relationships with your spouse and in-laws.', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 81, 0, 0, 0, '', 1, '', '', '3689968117801193', '2019-12-27 07:32:15', '2020-03-23 06:54:11', '2019-12-27 07:32:15'),
