(27, 'Bazichic March 2015', 'bazichik20191227102818.pdf', '6450748179241139.jpg', 0, 'Welcome to the entrepreneur edition of Bazichic Magazine! Are you cut out to be an entrepreneur? If you are, where and how should you get funding to kick-off your business? The answer to these questions can be found in your Bazi Chart. Also, we give Feng Shui tips on you can boost sales and attract retail customers.', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 70, 0, 0, 0, '', 1, 'application/pdf', '', '6450748179241139', '2019-12-27 10:27:33', '2020-03-23 06:51:14', '2019-12-27 10:27:33'),
