(47, 'The Annual Auxiliary Stars (?? Shen Sha)', 'bazichic20200323000001.pdf', '2748865475445638.jpg', 0, 'The Annual Auxiliary Stars eBook explains how we can use the Auxiliary Stars (?? Shen Sha) of the Bazi system in an annual reading. This method analyses the influence of the energy of the stars and gods on a person’s Bazi chart or destiny. In a person\'s Bazi Chart, these stars are derived from the Branch-Stem relationships of the year, month, day, hour or luck pillar of each year. The annual reading is based on the observation and comparison on these stars in the Bazi Chart.', 1, 3, 1, 'Josephine Phang', '', '', 120, 0, 0, 0, 'Recommended', 1, 'application/pdf', '', '2748865475445638', '2020-01-02 02:35:33', '2020-10-03 15:49:03', '2020-01-02 02:35:34'),
(48, 'Wishing Upon the Northern Star ', 'bazichik20210215084204.pdf', '8248053175953010.jpg', 0, 'The Wishing Upon the Northern Star eBook shows how we can tap into Big Dipper energy and command it work for us. To do this we simply make wishes for the things we want. In layman terms, this is known as the Law of Attraction. The eBook consists of simple 7 Star rituals, exercises and mantras to help you fulfil your wishes.', 1, 6, 1, 'Josephine Phang', '', '', 45, 0, 0, 0, 'Recommended', 1, 'application/pdf', '', '8248053175953010', '2020-01-02 08:37:55', '2022-10-23 15:31:20', '2020-01-02 08:37:56'),
