(57, '2021 Abundance Planner', 'bazichik20210701092337.pdf', '6064442862807913.jpg', 1, 'The 2021 Abundance Planner includes suggested activities to help you create abundance in life. This planner contains selected 2021 Chinese Solar Calendar, auspicious based on Dong Gong Rating, auspicious and inauspicious zodiac signs, Yi Ching, daily and hourly auxiliary stars and auspicious directions for each day. The planner also includes auspicious directions, Flying Star Charts, hexagram and Nobleman Stars of the month. (This copy is available for download- updated August 2021.)\r\n\r\n', 1, 7, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 399, 0, 0, 0, 'Featured', 1, 'application/pdf', '', '6064442862807913', '2021-01-01 08:43:33', '2021-09-01 00:16:10', '2021-01-01 00:43:33'),
