(58, 'Bazichic March 2021', 'bazichik20210316152635.pdf', '7845066686893535.png', 0, 'In this issue, we look into ways to navigate out of the COVID-19 Storm. First, \"What boat are you in now?\" helps you to identify your current situation. Discover the Noblemen in your life in \"Who is my Noble people in 2021?\" and learn how you can start making small, but positive changes in \"Optimize your Life\". We also look into the Earth Mother Scripture\'s forecast for the year 2021. ', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 63, 0, 0, 0, 'Recommended', 1, 'application/pdf', '', '7845066686893535', '2021-02-28 11:16:06', '2021-06-01 21:57:33', '2021-02-28 03:16:06'),
(60, 'Maximizing Period 7 House Feng Shui In Period 9', 'bazichik20210723201121.pdf', '1863091906316033.jpg', 0, 'This Feng Shui Reference Series eBook is to make it easier for enthusiasts and people with lack of Feng Shui knowledge to find and maximize the Qi of their house. It has been designed as a handy Reference eBook for people to find out and create the “right place” to live in. It is my wish that this eBook serves as a one-stop guide and reference for all levels of people who want to make the best out of the 30% Feng Shui of their property. The eBook contains recommendation of the best locations for the main door, bedrooms, kitchen, and water placement as well as stove direction for Period 7 House (house built in 1984-2003) to best tap into Period 9 Qi. The recommendation in this eBook is based on my best knowledge, research and experiences of San Yuan Xuan Kong Flying Stars and Eight Mansions.', 1, 1, 1, 'Josephine Phang', '', '', 0, 0, 0, 0, 'Featured', 1, 'application/pdf', '', '1863091906316033', '2021-07-23 20:09:52', '2021-07-29 07:49:47', '2021-07-23 12:09:52'),
(59, 'Bazichic June 2021', 'bazichik20210601215805.pdf', '1900663662748054.png', 0, 'In this issue, we look into ways to stay positive as the pandemic drags on. First, \"Mental Health Awareness\" helps you to identify your current state of mind. Discover which foods can help you stay positive in \"Eat your way to Positive Thinking.\" Learn how you can make use of auspicious sectors in “How to Stay Calm, Happy and Positive.” Attract abundance into your life with the influence of auspicious stars in \"Special Shen Sha for Tao Manifesting\" and understand yourself and the people around you better in “Sixty Personalities”. We look into why some people are still against COVID-19 preventive measures in “Show me your Badge!” and take a peek into the crystal ball for Malaysia’s COVID-19 Outlook and the Earth Mother Scripture\'s forecast for the year 2022. (Draft Copy)', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 75, 0, 0, 0, 'Recommended', 1, 'application/pdf', '', '1900663662748054', '2021-06-01 21:55:50', '2021-06-01 21:59:11', '2021-06-01 13:55:50'),
