(69, 'Bazichic September 2021', 'bazichik20210901001145.pdf', '7185614448344276.jpg', 0, 'In this issue, we look at Bazi and relationships, and explore the meaning of affinity through the lives of the UK royal couples - Prince William and Kate Middleton, and Prince Harry and Meghan Markle. Learn how Qi transitions from year to year from 2021 to 2022. We also use Qi Men analysis to forecast the outlook for the year 2022. Discover where to locate your kitchen for better health and regular income in \"Arranging the Kitchen for Health and Wealth.\" ', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 0, 0, 0, 0, 'Featured', 1, 'application/pdf', '', '7185614448344276', '2021-09-01 00:10:00', '2021-09-01 00:21:21', '2021-08-31 16:10:00'),
(70, 'Bazichic December 2021', 'bazichic2487744664858040.pdf', '2487744664858040.jpg', 0, 'The December 2021 issue features the Feng Shui and Chinese Astrology outlook for the year 2022. This issue divines what\'s in store in the year of the Water Tiger for the 12 signs of the Chinese Zodiac and the world at large. Also, learn how to make the most of the year by harnessing the year’s positive Annual Stars and avoiding Feng Shui afflicted sectors in 2022.', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 159, 0, 0, 0, 'Recommended', 1, '', '', '2487744664858040', '2021-11-30 21:23:19', '2022-01-11 19:23:25', '2021-11-30 13:23:19'),
(71, 'Bazichic 2022 eTongShu', 'bazichik20211130215128.pdf', '6245079414375135.jpg', 1, 'The Bazichic eTongShu consists of the 2022 Calendar, selected auspicious dates for Feng Shui activation and mitigation of Feng Shui affliction, monthly and annual flying star charts, special selected Jia Day for practising the Seven Star Path ritual. (This copy is available for download.)', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 0, 0, 0, 0, '', 1, 'application/pdf', '', '6245079414375135', '2021-11-30 21:49:52', '2021-11-30 21:51:41', '2021-11-30 13:49:52'),
(72, '2022 Abundance Planner', 'bazichik20220406223038.pdf', '5830555024127338.png', 1, 'The 2022 Abundance Planner includes suggested activities to help you create abundance in life. This planner contains selected 2022 Chinese Solar Calendar, auspicious based on Dong Gong Rating, auspicious and inauspicious zodiac signs, Yi Ching, daily and hourly auxiliary stars and auspicious directions for each day. The planner also includes auspicious directions, Flying Star Charts, hexagram and Nobleman Stars of the month. (This copy is available for download- updated 10 April 2022.)', 1, 7, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 0, 0, 0, 0, '', 1, 'application/pdf', '', '5830555024127338', '2022-01-01 00:07:43', '2022-04-06 22:31:11', '2021-12-31 16:07:43'),
(73, 'Bazichic March 2022', 'bazichik20220323122043.pdf', '7331487366746707.jpg', 0, 'In this issue, we look into ways to accelerate your life goals in 2022. First, \"Know Yourself\" helps you to reflect on and identify the truth of your current situation. Discover ways to expand your source of income in \"Where is my cheese?\" and learn how you can start making small, but positive changes in \"Five Essential Soft Skills for 2022\". We also look at the Earth Mother Scripture\'s forecast for the year 2022. There is a special highlight on Feng Shui in \"A Meridian Spot for an Emperor\".', 3, 4, 1, 'Josephine Phang, Ooi Eu Geen', '', '', 0, 0, 0, 0, 'Recommended', 1, 'application/pdf', '13.587277412415', '7331487366746707', '2022-02-26 15:03:49', '2022-03-23 12:20:43', '2022-02-26 07:03:49'),
(75, 'Bazichic June 2022', 'bazichik20220815230312.pdf', '4511972776355006.jpg', 0, 'In this issue, we look into ways to tap into the Period of 9 Qi. First, \"The Cosmic Trinity and Period 9\" explains the impact of the changing Qi to the Period 9. \"The Qi of Period 9\" points out the auspicious sectors to focus on in Period 9. Understand how you are affected in Period 9 in \"Period 9 Influence on Five Elements.\" Discover ways to improve and heal your health in \"The Good Health Star in Period 9\" and learn how to jump start the Qi of your property in \"Reviving the Energy of your Property\". We also look at whether you should \"Change the Period of your House.\" There is a special highlight on Feng Shui in \"??? Siheyuan\".', 3, 4, 1, 'Josephine, Ooi Eu Geen', '', '', 0, 0, 0, 0, 'Recommended', 1, 'application/pdf', '', '4511972776355006', '2022-06-01 02:20:11', '2022-08-15 23:03:46', '2022-05-31 18:20:11'),
(76, 'Bazichic September 2022', 'bazichik20220922212950.pdf', '9334522554288700.png', 0, 'In this issue, we share the results of some of our spooky sleuthing using Chinese Metaphysic techniques. We look for some insights into some infamous murders in \"Black Magic and Murder,\" \"The Life of Mona Fandey\", and \"An Angry Ghost Waits for Justice.\" \"The Real Hannibal Lecter\", tells of an author who finds inspiration in an unlikely place. \"Period 9 - The cycle of spirituality\" helps you discover the path to spirituality in the new period. Discover and avoid haunted properties in \"Why is a House Haunted?\", \"The Feng Shui of a Haunted House,\" and \"Visiting A Haunted House.\"\r\n', 3, 4, 1, 'Josephine, Ooi Eu Geen', '', '', 0, 0, 0, 0, '', 1, 'application/pdf', '', '9334522554288700', '2022-09-02 00:04:55', '2022-09-22 21:31:13', '2022-09-01 16:04:55'),
(78, 'Bazichic eTongShu 2023', 'bazichik20221201111223.pdf', '0599721892096135.png', 1, 'The Bazichic eTongShu consists of the 2023 Calendar, selected auspicious dates for Feng Shui activation and mitigation of Feng Shui affliction, monthly and annual flying star charts, special selected Jia Day for practising the Seven Star Path ritual. (This copy is available for download.)', 3, 4, 1, 'Josephine, Ooi Eu Geen', '', '', 0, 0, 0, 0, 'Featured', 1, 'application/pdf', '', '0599721892096135', '2022-12-01 11:09:56', '2022-12-09 20:26:55', '2022-12-01 03:09:56'),
(79, 'Bazichic March 2023', 'bazichik20230324112420.pdf', '0024922823879351.jpg', 0, 'In this issue, we look into ways to accelerate your life goals in 2023. First, \"Know Yourself\" helps you to reflect on and identify the truth of your current situation. Discover ways to expand your source of income in \"Where is my cheese?\" and learn how you can start making small, but positive changes in \"Five Essential Tech Skills for 2023\". There is a special highlight on Feng Shui in \"The Ancestral Tomb of Liu Bowen\".\r\n', 3, 4, 1, 'Josephine, Ooi Eu Geen', '', '', 0, 0, 0, 0, '', 1, 'application/pdf', '22.970393180847', '0024922823879351', '2023-03-01 17:07:09', '2023-03-24 11:24:20', '2023-03-01 09:07:09');
